import React from 'react';
import axios from 'axios';

function GetAccountByID(userID = 1) {
    axios.get('http://localhost:8080/accounts/1')
        .then(res=> {
            console.log(res.data.username)
        }).catch(err => {
        console.log(err)
    })
}

export default GetAccountByID;
